Test: Table Width and Height

        /* Reset for consistency */
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { font-family: 'Arial', sans-serif; font-size: 16px; }

        /* Test-specific CSS */
        .container {
            width: 400px;
            height: 300px;
            border: 2px solid #333;
            padding: 10px;
            overflow: auto;
        }
        table {
            width: 100%;
            height: 250px;
            border-collapse: separate;
            border-spacing: 5px;
        }
        th, td {
            padding: 10px;
            text-align: center;
            font-size: 14px;
            border: 1px solid #666;
            vertical-align: middle;
        }
        th {
            background-color: #e0e0e0;
            font-weight: bold;
            height: 50px;
        }
        .col1 { width: 25%; background-color: #ffcccc; }
        .col2 { width: 50%; background-color: #ccffcc; }
        .col3 { width: 25%; background-color: #ccccff; }
        .tall-row td { height: 60px; }
        .short-row td { height: 30px; }







